import React, { useState, useEffect } from 'react';
import './App.css';

const App = () => {
  const [url, setUrl] = useState('');
  const [quality, setQuality] = useState('');
  const [estimatedSize, setEstimatedSize] = useState('');
  const [progress, setProgress] = useState('');
  const [downloaded, setDownloaded] = useState('');
  const [speed, setSpeed] = useState('');
  const [eta, setEta] = useState('');
  const [remaining, setRemaining] = useState('');
  const [destination, setDestination] = useState('');
  const [logs, setLogs] = useState([]);

  const handleDownload = () => {
const eventSource = new EventSource(`http://localhost:8080/api/youtube/download/stream?url=${encodeURIComponent(url)}&format=${quality}`);


    eventSource.onmessage = (event) => {
      const data = event.data;
      if (data.startsWith('SIZE::')) {
        const parts = data.split('::');
        setEstimatedSize(parts[2]);
      } else if (data.startsWith('PROGRESS::')) {
        const parts = data.split('::');
        setProgress(parts[1]);
        setDownloaded(parts[2].replace('üì¶ ', ''));
        setSpeed(parts[3].replace('üöÄ ', ''));
        setEta(parts[4].replace('‚è≥ ', ''));
        setRemaining(parts[5].replace('üìâ ', ''));
      } else if (data.startsWith('üì•')) {
        setDestination(data.replace('üì• ', ''));
      } else if (data.startsWith('‚úÖ') || data.startsWith('‚ùå')) {
        setLogs((prev) => [...prev, data]);
        eventSource.close();
      } else {
        setLogs((prev) => [...prev, data]);
      }
    };
  };

  const formatOptions = ['8k', '4k', '1080p', '720p', '480p', '360p'];

  const handleFormatSelect = (fmt) => {
    setQuality(fmt);
    setEstimatedSize('Fetching...');

    fetch(`http://localhost:8080/api/youtube/probe?url=${encodeURIComponent(url)}&quality=${fmt}`)
      .then(res => res.text())
      .then(size => setEstimatedSize(size))
      .catch(err => setEstimatedSize('Unknown'));
  };

  return (
    <div className="min-h-screen bg-gray-950 text-white p-6 font-sans">
      <div className="max-w-2xl mx-auto bg-gray-900 rounded-2xl p-6 shadow-2xl">
        <h1 className="text-3xl font-bold text-center text-teal-400 mb-6">üé¨ YouTube Video Downloader</h1>

        <input
          type="text"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          placeholder="Enter YouTube URL"
          className="w-full p-3 rounded-xl border border-gray-700 bg-gray-800 text-white focus:outline-none focus:ring focus:ring-teal-400 mb-4"
        />

        <div className="flex flex-wrap gap-2 justify-center mb-4">
          {formatOptions.map((fmt) => (
            <button
              key={fmt}
              onClick={() => handleFormatSelect(fmt)}
              className={`px-4 py-2 rounded-xl border border-teal-400 text-teal-300 hover:bg-teal-700 hover:text-white transition ${quality === fmt ? 'bg-teal-700' : 'bg-gray-800'}`}
            >
              {fmt.toUpperCase()}
            </button>
          ))}
        </div>

        {estimatedSize && (
          <p className="text-center text-lg mb-4 text-yellow-400">
            üìè Estimated Size for {quality.toUpperCase()}: <span className="font-bold">{estimatedSize}</span>
          </p>
        )}

        <button
          onClick={handleDownload}
          disabled={!url || !quality}
          className="w-full bg-teal-500 text-white font-bold py-3 rounded-xl hover:bg-teal-600 transition mb-6 disabled:bg-gray-600"
        >
          ‚¨áÔ∏è Download
        </button>

        {progress && (
          <div className="bg-gray-800 p-4 rounded-xl space-y-2">
            <p className="text-blue-300">üîÅ Progress: <span className="font-bold text-white">{progress}</span></p>
            <p className="text-purple-300">üì¶ Downloaded: <span className="font-bold text-white">{downloaded}</span></p>
            <p className="text-green-300">üöÄ Speed: <span className="font-bold text-white">{speed}</span></p>
            <p className="text-yellow-300">‚è≥ ETA: <span className="font-bold text-white">{eta}</span></p>
            <p className="text-red-300">üìâ Remaining: <span className="font-bold text-white">{remaining}</span></p>
          </div>
        )}

        {destination && (
          <p className="mt-4 text-green-400">üì• Destination: {destination}</p>
        )}

        {logs.length > 0 && (
          <div className="mt-6 bg-black text-sm p-3 rounded-xl max-h-60 overflow-y-auto border border-gray-700">
            {logs.map((log, idx) => (
              <p key={idx} className="text-gray-300">{log}</p>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
